import React from "react";

export default function Box(props) {

  const [on, setOn] = React.useState(props.on);

  const change = () => setOn(prev => !prev);
  return (
    <div style={{ border: '1px solid black', height: '100px', width: '100px', display: 'inline-block', margin: '5px', borderRadius: '5px', background: on ? 'black': 'none' }} onClick={ change }></div>
  );
};
